import React from 'react';
import EditCard from './EditCard';

const CardList = ({ cardList, deleteCard }) => {
    return (
        <ul>
            {cardList.map((card) => {
                return <li id={card.card_id} key={card.card_id}>{card.card_name}<button onClick={deleteCard}>Delete Card</button><EditCard /></li>
            })}
        </ul>
    )
}

export default CardList;
